import React from "react";
import {Button, FlatList, SafeAreaView, Text, TouchableOpacity} from "react-native";

const DATA = [
    {
        id: "1",
        title: "First Item",
    },
    {
        id: "2",
        title: "Second Item",
    },
    {
        id: "3",
        title: "Third Item",
    },
];

const App = () => {

    function onClick() {
        alert('Test')
    }

    const renderItem = ({item}) => {
        return (
            <Button onPress={()=>onClick()} style={styles.title} title={item.title}/>
        );
    };

    return (
        <SafeAreaView style={styles.container}>
            <FlatList
                data={DATA}
                renderItem={renderItem}/>
        </SafeAreaView>
    );
};

const styles = {
    container: {
        flex: 1
    },
    item: {
        padding: 5,
        marginHorizontal: 7,
        marginVertical:5
    },
    title: {
        fontSize: 32,

    },
};

export default App;
